import React from 'react';
import {makeStyles} from '@material-ui/core/styles';
import {BottomNavigation, BottomNavigationAction} from '@material-ui/core';
import FacebookIcon from '@material-ui/icons/Facebook';
import InstagramIcon from '@material-ui/icons/Instagram';
import LinkedInIcon from '@material-ui/icons/LinkedIn';
import GitHubIcon from '@material-ui/icons/GitHub';


const useStyles= makeStyles({
    root:{
        "&.MuiBottom-NavigationAction-root":{
            minWidth:0,
            maxWidth:200
        },
        "& .MuiSvgIcon-root":{
            fill:'white',
            "&:hover":{
                fill:'tomato',
                fontSize:'1.8rem'
            }
        }
    },


})

function BottomNav(){

    const classes =useStyles();

    return(
        <BottomNavigation width="auto" style={{ background:'#909090',opacity:0.9}}>

            <BottomNavigationAction style={{padding:0}} className={classes.root} icon={<FacebookIcon />} />

            <BottomNavigationAction style={{padding:0}}  className={classes.root} icon={<LinkedInIcon/>} />

            <BottomNavigationAction style={{padding:0}}  className={classes.root} icon={<InstagramIcon />} />

            <BottomNavigationAction style={{padding:0}}  className={classes.root} icon={<GitHubIcon />} />

        </BottomNavigation>
    )
}

export default BottomNav
